import React from "react";
import './Page4.scss';

const ITEMS = [
  {id: "1", itemImage: img1, itemTitle: "— Open PRO lets me quickly get the insights I care about so that I can focus on my productive work. I've had Open PRO for about 24 hours now and I honestly don't know how I functioned without it before.", itemText: "Anastasia Dan - UX Board"}
]

export const Page4 = () => {
  return (
    <div className="page4">
      <div className="page4__inner">
        <div className="page4__title">
          <h2 className="page4__titleName"></h2>
          <p className="page4__textName"></p>
        </div>
        <div className="page4__items">
          <div className="page4__item">
            <div className="page4__itemImage"></div>
            <div className="page4__itemTitle"></div>
            <div className="page4__itemText"></div>
          </div>
        </div>
      </div>
    </div>
  );
};
